import React from 'react';
import PropTypes from 'prop-types';
import './style.css';

const Location=(props)=>{
    const city=props.city;
    return(
    <div>
        <h1>
            {city}    
        </h1> 
    </div>
    )
};
Location.protoTypes={
    Location:PropTypes.string.isRequired,
}; 
export default Location;
